import * as React from 'react';
import { styled } from '@mui/material/styles';
import { Grid, Paper, Button, Typography } from '@mui/material';
import useStyles from "./Styles";


export default function BasicGrid() {
    const classes = useStyles();

    return (
        <Grid container className={classes.root} rowSpacing={0} columnSpacing={0}>
            <Grid item xs={12} className={classes.textItem}>
                <Typography variant="h2" className={classes.text}>ברוך הבא, בחר מהאפשרויות הבאות</Typography>
            </Grid>
            <Grid item xs={12} sm={6} md={4} lg={3} className={classes.item}>
                    <Button variant="contained" className={classes.button}>אני יודע איזה כיתה אני רוצה</Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4} lg={3} className={classes.item}>
                    <Button variant="contained" className={classes.button}>לחיפוש כיתה לפי תאריך</Button>
            </Grid>
        </Grid>
    );
}
